import React, { Component } from 'react'
import '../css/Login.css';

import TextField from '../components/TextField';
import Button from '../components/Button';

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Alert from 'react-bootstrap/Alert'

export default class Login extends Component {



    loginAction = () => {
        localStorage.setItem("userData", JSON.stringify({
            "status": 1,
            "message": "Success",
            "userName": "Douglas Ciole",
            "accessToken": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOjEsInVzZXJOYW1lIjoiRG91Z2xhcyBDaW9sZSIsImlhdCI6MTU5MzczODU4MCwiZXhwIjoxNTkzNzM5MTgwfQ.LvuJSvGmZNgZRTP9cRbXx8huQiDtA537og5YanzBeaU",
            "refreshToken": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOjEsInVzZXJOYW1lIjoiRG91Z2xhcyBDaW9sZSIsImlhdCI6MTU5MzczODU4MH0.oDGzlcqx_tZZVSez7B_UrB_XrWidxm1ypawSaI0IjYg",
            "companyName": "ChangeME"
        }));

        window.location = "/clients";
    }


    render() {
        return (
            <>
                <div className="alert-message-container">
                    <Alert show={false} key='ewfwef' variant='danger'>
                        E-mail or Password is incorrect!
                    </Alert>
                </div>
                <Container>
                    <Row>
                        <Col className="login-title" md={{ span: 5, offset: 4 }} lg={{ span: 5, offset: 4 }} sm={{ span: 5, offset: 4 }} xs={{ span: 5, offset: 4 }}>
                            Login
                        </Col>
                    </Row>

                    <Row>
                        <Col md={{ span: 5, offset: 4 }} lg={{ span: 5, offset: 4 }} sm={{ span: 5, offset: 4 }} xs={{ span: 5, offset: 4 }}>
                                <TextField label="E-Mail" />
                                <TextField type="password" label="Password" />
                                <div>
                                    <Button onClick={this.loginAction}>Login</Button>
                                </div>
                        </Col>
                    </Row>
                </Container>
            </>
        )
    }
}
